## Tooltip

The Tooltip component is a simple component that shows a message when the user hovers over an element.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, message }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      onMouseEnter={() => setTooltip(message)}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
      {tooltip && <div className="tooltip">{tooltip}</div>}
    </div>
  );
};

export default Tooltip;
```

## TooltipContext

The TooltipContext is a React Context that is used to manage the state of the Tooltip component.

```jsx
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ setTooltip }}>
      {children}
      {tooltip && <div className="tooltip">{tooltip}</div>}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```

## Usage

To use the Tooltip component, you need to wrap your application with the TooltipProvider component.

```jsx
import React from 'react';
import { TooltipProvider } from './TooltipContext';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip message="Hello World">
          <button>Hover me</button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

## Conclusion

In this example, we have created a Tooltip component that can be used in different places in our application. We have used React Context to manage the state of the Tooltip component, so that we can close the previously opened Tooltip and so on. This is a simple example, but it can be extended to support more features, such as custom positions, animations, and so on.
